  return <section>
    <div className='container mx-auto'> 
      <div>
        {/*item*/}
        <div className='flex item-center gapx'>
          <div>
            <HiChartBar/>
          </div>
        </div>
      </div>
    </div>
  </section>;
};

export default Stats;
